import React,{Component} from 'react';

class FollowProfileButton extends Component{
    render(){
        return (
            <div className="d-inline mt-5">

<button className="btn btn-success btn-raised mt-5">
                    Follow
                    </button>
                    <button className="btn btn-success btn-raised mt-5">
                    Unfollow
                    </button>

            </div>
        )
    }
}

export default FollowProfileButton
